// start dropdown
function DropDown(el) {
    this.dd = el;
    this.initEvents();
}
DropDown.prototype = {
    initEvents : function() {
        var obj = this;

        obj.dd.on('click', function(event){
            $(this).toggleClass('active');
            event.stopPropagation();
        });
    }
}

$(function() {
    var dd = new DropDown( $('.dropdown-main') );

    $(document).click(function() {
        // all dropdowns
        $('.dropdown-main').removeClass('active');
    });
});
// end dropdown


